colId.description:
/** The unique ID to give the column. This is optional. If missing, the ID will default to the field.
 * If both field and colId are missing, a unique ID will be generated.
 * This ID is used to identify the column in the API for sorting, filtering etc. */

toolPanel.description:
/** The tool panel component to use as the panel.
 * The provided panels use components `agColumnsToolPanel` and `agFiltersToolPanel`.
 * To provide your own custom panel component, you reference it by name here. */

keepRenderedRows.description:
/** If true, the grid has new data loaded, eg user called setRowData(), otherwise
 * it's the same data but sorted or filtered, in which case this is true, and rows
 * can animate around (eg rowNode id 24 is the same row node as last time). */

filterParams.description:
/** The params object passed to the filter. 
 * This is to allow the floating filter access to the configuration of the parent filter.
 * For example, the provided filters use debounceMs from the parent filter params. */

currentParentModel.description:
/** This is a shortcut to invoke getModel on the parent filter.
 * If the parent filter doesn't exist (filters are lazily created as needed)
 * then it returns null rather than calling getModel() on the parent filter. */

